import React, { useEffect, useState } from "react";
// import Axios from "axios"
// import { useNavigate } from "react-router-dom"
// import { checkGroup } from "../Utilities/CheckGroup"

function NavBar() {
    // const navigate = useNavigate()
    // const [admin, setAdmin] = useState(false)

    // async function logout() {
    //   const response = await Axios.get("/auth/logout", { withCredentials: true })
    //   navigate("/")
    // }

    // async function checkAdmin() {
    //   const isAdmin = await checkGroup("admin")
    //   setAdmin(isAdmin)
    // }

    // useEffect(() => {
    //   checkAdmin()
    // }, [])

    return (
        <>
            <nav id="navbar-nav" className="navbar navbar-expand-lg bg-body-tertiary">
                <div id="navbar-div" className="container-fluid">
                    <a id="navbar-tms-link" className="navbar-brand" href="/">
                        Task Management System
                    </a>
                    <button
                        id="navbar-collapse-button"
                        className="navbar-toggler"
                        type="button"
                        data-bs-toggle="collapse"
                        data-bs-target="#navbar-content-div"
                        aria-controls="navbar-content-div"
                        aria-expanded="false"
                        aria-label="Toggle navigation"
                    >
                        <span
                            id="navbar-collapse-span"
                            className="navbar-toggler-icon"
                        ></span>
                    </button>

                    <div id="navbar-content-div" className="collapse navbar-collapse">
                        <ul
                            id="navbar-content-ul"
                            className="navbar-nav me-auto mb-2 mb-lg-0"
                        >
                            <li id="navbar-profile-l" className="nav-item">
                                <a
                                    id="navbar-profile-link"
                                    className="nav-link"
                                    aria-current="edit-profile-page"
                                    href="/profile"
                                >
                                    Profile
                                </a>
                            </li>
                            {admin ? (
                                <li id="navbar-user-management-l" className="nav-item">
                                    <a
                                        id="navbar-user-management-link"
                                        className="nav-link"
                                        aria-current="user-management-page"
                                        href="/user-management"
                                    >
                                        User Management
                                    </a>
                                </li>
                            ) : (
                                <></>
                            )}
                        </ul>
                        <button
                            id="navbar-logout-button"
                            type="button"
                            className="btn btn-secondary"
                            onClick={logout}
                        >
                            Logout
                        </button>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default NavBar;
